(45077, '9265B2F3-9723-441E-ADEA-490E46A6142D', 'As IÔ∏è reflect a few hours before our evenings away, IÔ∏è am really proud of how far we‚Äôve come. You‚Äôve adapted and tweaked and made me feel safe in our non traditional configuration. I‚Äôm so excited we have outlets for play, sexiness, fun and new external fodder, while being so very focused on us as a couple always looking for connection and primacy. You are my heart and soul and IÔ∏è couldn‚Äôt love you more. Thank you for being on this very long journey and for making it get to ‚Äúright.‚Äù ', 'Nitzan', 'David', '2022-03-08T14:35:46.538862'),
(45078, 'C67D6E69-F53A-48EA-B4FC-DF161BCF8372', 'Yes, I have similar feelings. I‚Äôm happy to explore and excited for you to have your own playful experiences‚Ä¶and not feel at all disregulated. It feels like an edge‚Ä¶but a good one that sharpens and doesn‚Äôt cut. The fact that I can go and do my own thing and then‚Ä¶the best part‚Ä¶.come home and be together with you! I love you and wish you the best time!', 'David', 'Nitzan', '2022-03-08T15:02:32.512271'),
