(45212, '6811AAC6-8474-44DD-9665-876EAA38C399', 'Hey love, thank you for being loving and playful with me today. I too have been a bit sensitive‚Ä¶and while for you that gets expressed as a need for me to reach out and be expressive and loving in words, for me, it is a need for touch. Things felt a bit out of whack for me on tuesday night, so after our extended conversation last night, I felt depleted and a bit needy.  I do think we are finding a way that works for us‚Ä¶at least for now. And I feel more clear on how I can work through moments that feel triggering to me. I love you so much‚Ä¶any space between us rocks me too. And, there is nothing I love more than coming home from morning drop off and getting a glimpse of my beautiful, hot wife naked in the bathroom. I‚Äôm looking forward to a sweet Shabbat, some naked time with you‚Ä¶and some Purim!', 'David', 'Nitzan', '2022-03-11T09:26:16.971740'),
(45229, 'AFEB57D1-A84F-4712-A1AB-2C30CB7888C1', 'Hi love, this note means a lot to me. Thank you so very much for it. Appreciate the thoughtfulness and the ups and downs of last night. Somehow you read my body language exactly the opposite of what IÔ∏è intended at the end of the night. IÔ∏è wanted deeply to cuddle and snuggle and fall asleep in your arms. So please help me know what it is that IÔ∏è can do to make sure you know that IÔ∏è‚Äôm loving your touch and want more of it. ', 'Nitzan', 'David', '2022-03-11T15:13:14.485342'),
